// SPDX-License-Identifier: MIT
pragma solidity ^0.8.17;
// this is for objects
contract AssignLevel{
    mapping(uint => string) private Levels;  // mapping for assinging levels 
    // maps do not allow duplicate keys but key-value pair will be overwritten  
    mapping(bytes32 => uint) public Objects; // only hash of og evidence is stored; since hash is unique there are no chances of duplicacy   
    bytes32[] private Current_Evi; // evidence which have been added but not assigned a level
    bytes32[] private Regis_Evi; // evidence which have been assigned a level
    // EVENTS
    event EvidenceRegistered(string, bytes32, uint);
    event EvidenceAssignedLevel(string);
    constructor(){  // casey's scaling  will start this from 1 to 7 cuz map allocates zero value to  all possible keys, // NO NEED TO MODIFY CASEY'S SCALING HERE BUT STILL DID
        //so even if the qualification is not valid it will have a level of 0
        Levels[7] = "Certain";
        Levels[6] = "Almost Certain";
        Levels[5] = "Probable";
        Levels[4] = "Somewhat Uncertain";
        Levels[3] = "Highly Uncertain";
        Levels[2] = "Possible";
        Levels[1] = "Incorrect";
    }
    function DoesExists (bytes32 key) public view returns(bool){  // check if evidence exists , high gas requirement , but it eezz what it eez 
        for(uint i =0; i<Current_Evi.length; i++){
            if(Current_Evi[i] == key){
                return true; 
            }
        }
        return false;
    }
    function isAssigned(bytes32 key)public view returns(bool) {  // check if evidence has been assigned a level or not 
        for(uint i =0; i<Regis_Evi.length; i++){
            if(Regis_Evi[i] == key){
                return true; 
            }
        }
        return false;
        
    }

    function registerObj(bytes32 key) public payable{ // check for authorization in evidence contract
        require(DoesExists(key) == false, "Evidence already added" );
        //require(getLevel(qualification)> 0, "Invalid qualification";
        //Objects[key] = calculateLevel(qualification);  // meta data is qualification
        Current_Evi.push(key);
        emit EvidenceRegistered("Evidence Registered", key, Objects[key]);
    }

    function setlevel(bytes32 key) public payable {
        require (isAssigned(key) == false, "Evidence already assigned level");
        uint level=(Regis_Evi.length % 7)+1;
        Objects[key] = level;
        Regis_Evi.push(key);
        emit EvidenceAssignedLevel("Evidence as been assigned a level");
       
    }

    function returnLevel(bytes32 key) public view returns(uint){ // for backend side 
        require(DoesExists(key) == true, "Object does not exists");
        uint lvl = Objects[key];
        return lvl;
    }

    function returnqualifiction(bytes32 key) public view returns(string memory out){  // for user side
        require(DoesExists(key) == true, "Object does not exists");
        uint lvl  = Objects[key];
        return(Levels[lvl]);
    }
}
